# Complete the countTriplets function below.
def countTriplets(arr, r):

    counter = Counter(arr)
    fn_candidates = {k: 0 for k in counter}
    rt_count = 0

    for val in arr:  # val works as middle element of pg
        counter[val] -= 1
        ln = val * r
        fn = val / r
        if fn in fn_candidates and ln in counter:
            rt_count += fn_candidates[fn] * counter[ln]
        fn_candidates[val] += 1
    return rt_count

